/**
 * @brief Group entries by ProcFlags pattern for targeted testing
 */
inline std::map<uint32_t, std::vector<SpellProcTestEntry>> GroupByProcFlags()
{
    std::map<uint32_t, std::vector<SpellProcTestEntry>> grouped;
    for (auto const& entry : GetAllSpellProcTestEntries())
    {
        grouped[entry.ProcFlags].push_back(entry);
    }
    return grouped;
}

/**
 * @brief Group entries by HitMask for targeted testing
 */
inline std::map<uint32_t, std::vector<SpellProcTestEntry>> GroupByHitMask()
{
    std::map<uint32_t, std::vector<SpellProcTestEntry>> grouped;
    for (auto const& entry : GetAllSpellProcTestEntries())
    {
        grouped[entry.HitMask].push_back(entry);
    }
    return grouped;
}

/**
 * @brief Group entries by SpellFamilyName for class-specific testing
 */
inline std::map<uint32_t, std::vector<SpellProcTestEntry>> GroupBySpellFamily()
{
    std::map<uint32_t, std::vector<SpellProcTestEntry>> grouped;
    for (auto const& entry : GetAllSpellProcTestEntries())
    {
        grouped[entry.SpellFamilyName].push_back(entry);
    }
    return grouped;
}

